export default (function(a,b,c,d,e,f){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:d,pageSize:25,pageCount:d,total:5}}},AAWLE0ITDk:{data:{id:2554,attributes:{imdbId:"tt0065086",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BM2FjNzA1YTktNmE1Ny00MDY2LWI1N2ItNTk0NWZkMmYxZDk1XkEyXkFqcGdeQXVyNjQ2MjQ5NzM@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"43%"}],item_lang:{data:{id:3217,attributes:{title:"That Cold Day in the Park",plot:"Robert Altman's sadly neglected film that, along with his later \"Images\", fits into the unconventional psycho-thriller mold. A bizarre story with Sandy Dennis as a \"spinster\" who takes in a handsome and seemingly mute young man whose name is never revealed (Michael Burns). She imprisons The Boy (as he is identified in the credits) and supplies his every need, including a prostitute (Luana Anders), whom she brings home for his pleasure.",slug:"that-cold-day-in-the-park"}}},books:{data:[{id:12281,attributes:{title:"Grande Dame Guignol Cinema",description:"This critically analytical filmography examines 45 movies featuring “grande dames” in horror settings. Following a history of women in horror before 1962’s What Ever Happened to Baby Jane?, which launched the “Grande Dame Guignol” subgenre of older women featured as morally ambiguous leading ladies, are all such films (mostly U.S.) that came after that landmark release. The filmographic data includes cast, crew, reviews, synopses, and production notes, as well as recurring motifs and each role’s effect on the star’s career.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gPuyHmIcHbwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:true,published:"2009-10-21",publisher:f,subtitle:"A History of Hag Horror from Baby Jane to Mother"}},{id:12282,attributes:{title:"Sandy Dennis",description:"This is the first book-length study of the American actress Sandy Dennis (1937–1992). Winner of two successive Tony Awards for her work in the theatre in 1963 and 1964, she moved into film in supporting roles. For her performance in Who’s Afraid of Virginia Woolf? (1966) Dennis won the Best Supporting Actress Academy Award. She starred in films like Up The Down Staircase (1967), The Fox (1968), Sweet November (1968), That Cold Day in the Park (1969), Thank You All Very Much (1969), and Come Back to the 5 & Dime Jimmy Dean, Jimmy Dean (1982). Full information is provided for each film and television appearance, with cast and crew credits, synopses, notes, release information, reviews, and DVD availability.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=fd-xAQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:b,published:"2013-11-08",publisher:f,subtitle:"The Life and Films"}},{id:12283,attributes:{title:"Cities RankedÂ & Rated",description:"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Nblmo4F3qLMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Bert Sperling","Peter Sander"],firstBook:b,published:"2004-03-15",publisher:"John Wiley & Sons",subtitle:"More than 400 Metropolitan Areas Evaluated in the U.S. and Canada"}},{id:12284,attributes:{title:"The Best Places for Everything",description:"An accessible reference to where to find top-recommended international venues for adventure and learning shares informative facts, industry secrets and expert travel advice for everything from scenic hot-air balloon rides and shark diving to cooking classes and truffle-hunting. Original.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qgyoAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Peter Greenberg"],firstBook:b,published:"2012-05-08",publisher:"Rodale",subtitle:"The Ultimate Insider's Guide to the Greatest Experiences Around the World"}},{id:12285,attributes:{title:"The Secret Corps",description:"From New York Times Bestselling author, Peter Telep, comes the fast-paced thriller where corruption within the U.S. intelligence agencies are uncovered by those with the ultimate courage, honor, and commitment to our great nation - The Marines. \"The marines have landed (finally) in the genre...stand by for action!\"—Captain Dale Dye, USMC (Ret) Marine, Author, Actor and Filmmaker When a small town terrorist invasion results in a tragic death, retired Marine Master Sergeant James \"Johnny\" Johansen agonizes over questions whose answers threaten his loved ones, his career, and his company. The most serious question of all—is Johnny's family linked to Islamic extremists in the United States? Johnny turns to his former brothers-in-arms, Willie, Corey, and Josh. Relying on their skills as highly trained marines, the team uncovers a treacherous plot involving renegade defense contractor and co-conspirators at the highest levels of U.S. intelligence. Risking their lives to reveal the shocking details of the operation, Johnny and his friends discover that hundreds of terrorists are poised to launch a coast-to-cast attack on American soil. Time is running out! Who can Johnny trust? No one, except...the Secret Corps.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=k4RTEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Peter Telep"],firstBook:b,published:"2022-01-04",publisher:"Simon and Schuster",subtitle:"A Thriller"}}]}}},meta:{}}},prerenderedAt:1682568356402}}("movie",null,"series",1,"Peter Shelley","McFarland"))